import Header from '../../Header/Header';
import Footer from '../../../components/Footer/Footer';
import { useParams } from "react-router-dom";
function UserMovieDetail() {
    let { id } = useParams();

    return (
        <div>
            <Header/>
            <body className="container">
                <h1>{id}</h1>
            </body>
            <Footer/>
        </div>
    )
}

export default UserMovieDetail
